    //===================================================================================================================================================================================================================
    //      The story : right dodecahedra in hyperbolic 3-space H form a one parameter family up to hyperbolic motions.
    // They are parameterezid by, say, the length of their edge. The angle between two adjacent faces takes all the values below the
    // euclidean value of the angle. There is thus unique up to motion right-angled dodecahedron D. The face angles of D are also pi/2
    // and exactly three faces meet in one vertex. Reflections in face planes and all the possible combinations of such reflections of D
    // tesselate H. 8 dodecahedra meet at each vertex. Reflections however change space orientation and it is better to use their compositions
    // with reflection about center of D. The discrete subgroup of hyperbolic motions generated by these 12 transformation is exactly the
    // Poincare group. The factor space by this group is the first example of homology sphere 3-manifold.
    //===================================================================================================================================================================================================================

    //===================================================================================================================================================================================================================
    //      Essentially the code below computes all the elements of the described Poincare group that are generated by no more than certain amount
