        std::vector<glm::dmat4> generate_domains5()
        {
            std::vector<glm::dmat4> domains;

            // initial domain
            domains.push_back(glm::dmat4(1.0));

            // level 1 domains
            for(int i = 0; i < F; ++i) domains.push_back(transform[i]);

            // level 2 domains
            for(int i = 0; i < 102; ++i)
            {
                int idx0 = level2[i] & 0xF;
                int idx1 = level2[i] >> 4;
                domains.push_back(transform[idx1] * transform[idx0]);
            }

            // domains of level 3, 4 and 5
            int source_index = 13;
            for (int i = 0; i < sizeof(level5) / sizeof(std::uint32_t); ++i)
            {
                std::uint32_t code = level5[i];
                for (int j = 0; j < 8; ++j)
                {
                    int q = code & 0xF;
                    code >>= 4;
                    if (q == 0xF)
                    {
                        if (i == (sizeof(level5) / sizeof(std::uint32_t) - 1)) printf("Last used index = %d", source_index);
                        source_index++;
                    }
                    else
                        domains.push_back(domains[source_index] * transform[q]);
                }
            }

            return domains;
        }

        GLuint generate_SSBO5()
        {
            std::unique_ptr<glm::mat4[]> domains(new glm::mat4[57741]);

            int index = 0;
            domains[index++] = glm::mat4(1.0f);
            for(int i = 0; i < F; ++i) domains[index++] = glm::mat4(transform[i]);

            for(int i = 0; i < 102; ++i)
            {
                int idx0 = level2[i] & 0xF;
                int idx1 = level2[i] >> 4;
                domains[index++] = glm::mat4(transform[idx1] * transform[idx0]);
            }

            int source_index = 13;
            for (int i = 0; i < sizeof(level5) / sizeof(std::uint32_t); ++i)
            {
                std::uint32_t code = level5[i];
                for (int j = 0; j < 8; ++j)
                {
                    int q = code & 0xF;
                    code >>= 4;
                    if (q == 0xF)
                    {
                        if (i == (sizeof(level5) / sizeof(std::uint32_t) - 1)) printf("Last used index = %d", source_index);
                        source_index++;
                    }
                    else
                        domains[index++] = domains[source_index] * glm::mat4(transform[q]);
                }
            }

            struct
            {
                bool operator () (const glm::mat4& lhs, const glm::mat4& rhs)
                {
                    return lhs[3][3] > rhs[3][3];
                }
            } mat4_dist_order;

            std::sort(&domains[0], &domains[57741], mat4_dist_order);


            GLuint ssbo_id;
            glGenBuffers(1, &ssbo_id);
            glBindBuffer(GL_SHADER_STORAGE_BUFFER, ssbo_id);
            glBufferData(GL_SHADER_STORAGE_BUFFER, 57741 * sizeof(glm::mat4), glm::value_ptr(domains[0]), GL_STATIC_DRAW);
            glBindBufferRange(GL_SHADER_STORAGE_BUFFER, 0, ssbo_id, 0, 57741 * sizeof(glm::mat4));

            return ssbo_id;
        }

