    glm::dmat4 reflection_matrix(const glm::dvec4 & v)
    {
        return glm::dmat4(1.0) - 2.0 * glm::dmat4(v[0] * v, v[1] * v, v[2] * v, -v[3] * v);
    }

    glm::mat4 reflection_matrix(const glm::vec4 & v)
    {
        return glm::mat4(1.0f) - 2.0f * glm::mat4(v[0] * v, v[1] * v, v[2] * v, -v[3] * v);
    }

    double norm(glm::dvec4 v)
    {
        return v[0] * v[0] + v[1] * v[1] + v[2] * v[2] - v[3] * v[3];
    }

    float norm(glm::vec4 v)
    {
        return v[0] * v[0] + v[1] * v[1] + v[2] * v[2] - v[3] * v[3];
    }

    double dot(const glm::dvec4 & a, const glm::dvec4 & b)
    {
        return a[0] * b[0] + a[1] * b[1] + a[2] * b[2] - a[3] * b[3];
    }

    double distance(const glm::dvec4 & a, const glm::dvec4 & b)
    {
        return glm::acosh(-dot(a, b));
    }
